  Grid,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@material-ui/core";

const Portfolio = () => {
  return (
    <div>
      <Box component="div">
        <Navbar />
        <Grid container justify="center" alignItems="center">
          <Card>
            <CardActionArea>
